body.script:
    function dosearch() {
      var errorSearch = document.querySelector('input[name="errorSearch"]').value.trim();
      var searchLocation = document.querySelector('input[name="searchLocation"]:checked').value;
      if (errorSearch.length  && searchLocation.length) {
        window.location.href = searchLocation + encodeURIComponent(errorSearch);
      }
    };

    var input = document.querySelector('input[name="errorSearch"]')
    input.onkeydown = (e) => {
      if (e.keyCode === 13) {
        e.preventDefault()
        dosearch()
      }
    };
